function compute_h(u::AbstractVector, t::Real, p_ode_problem::AbstractVector, θ_observable::AbstractVector,
               θ_non_dynamic::AbstractVector, parameter_info::ParametersInfo, observableId::Symbol,
                  parameter_map::θObsOrSdParameterMap)::Real 
	if observableId === :pRII_Microscopy 
		observableParameter1_pRII_Microscopy = get_obs_sd_parameter(θ_observable, parameter_map)
		return observableParameter1_pRII_Microscopy * ( θ_non_dynamic[2] + θ_non_dynamic[6] * ( 2.0 * u[24] + 2.0 * u[19] + 2.0 * u[15] + 2.0 * θ_non_dynamic[3] * ( u[12] + u[23] + u[7] + u[21] ) + 2.0 * ( u[25] + u[9] ) * ( θ_non_dynamic[3] - θ_non_dynamic[10] * ( θ_non_dynamic[3] - 1.0 ) ) ) ) 
	end

	if observableId === :pRII_Western 
		return θ_non_dynamic[5] * ( 2.0 * u[24] + 2.0 * u[12] + 2.0 * u[19] + 2.0 * u[25] + 2.0 * u[23] + 2.0 * u[15] + 2.0 * u[7] + 2.0 * u[9] + 2.0 * u[21] ) 
	end

	if observableId === :Calpha_Microscopy 
		observableParameter1_Calpha_Microscopy = get_obs_sd_parameter(θ_observable, parameter_map)
		return observableParameter1_Calpha_Microscopy * ( θ_non_dynamic[1] + θ_non_dynamic[4] * ( 2.0 * u[16] + 2.0 * u[17] + 2.0 * θ_non_dynamic[3] * ( u[12] + u[23] + u[7] + u[21] ) + 2.0 * ( u[25] + u[9] ) * ( θ_non_dynamic[3] - θ_non_dynamic[10] * ( θ_non_dynamic[3] - 1.0 ) ) ) ) 
	end

end

