		return noiseParameter1_pRII_Microscopy * θ_non_dynamic[6] * θ_non_dynamic[8] 
	end

	if observableId === :pRII_Western 
		return θ_non_dynamic[5] * θ_non_dynamic[9] 
	end

	if observableId === :Calpha_Microscopy 
		return θ_non_dynamic[4] * θ_non_dynamic[7] 
	end


end

